import styled from "styled-components";
import { Col, Row } from "react-bootstrap";
import axios from "axios";

const StyledDiv = styled.div`
  margin-top: 5.5rem;
  background-color: #edcac4;
  display: flex;
  justify-content: center;
  align-items: center;
  height: 5rem;
`;

const Header = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 4rem;
  outline: 2px solid white;
  border-radius: 10px;
  background-color: #89abe3;
`;

const Title = styled.div`
  text-align: center;
  color: white;
  width: 10rem;
  font-size: 2rem;
`;

function ForHimPage() {
  return (
    <StyledDiv>
      <Header>
        <Title>For Him</Title>
      </Header>
    </StyledDiv>
  );
}

export default ForHimPage;
